import React from 'react';
import {
    useParams
} from "react-router-dom";
import './comun.css';
import './botones.css';
import './inicio.css';

function DetalleProducto(){
    let { idProducto } = useParams();

    return(
        <main id="main">
            <div>{idProducto}</div>
        </main>
    );
}

export default DetalleProducto;
